import React from 'react';

const Resume: React.FC = () => {
    return (
        <div>
            <h1>Resume</h1>
            <h2>Education</h2>
            <ul>
                <li>Bachelor of Science in Computer Science - University XYZ (2018)</li>
                <li>Master of Science in Software Engineering - University ABC (2020)</li>
            </ul>
            <h2>Experience</h2>
            <ul>
                <li>Software Developer at Company A (2020 - Present)</li>
                <li>Intern at Company B (2019 - 2020)</li>
            </ul>
            <h2>Skills</h2>
            <ul>
                <li>JavaScript, TypeScript, React</li>
                <li>Node.js, Express</li>
                <li>HTML, CSS</li>
                <li>Git, GitHub</li>
            </ul>
        </div>
    );
};

export default Resume;
